import React from 'react';

const WS = () => {

    return (
        <div>
            <SockJsClient url='http://localhost:8080/ws' topics={['/topics/all']}
              onMessage={(msg) => { console.log(msg); }}
              ref={ (client) => { this.clientRef = client }} />
        </div>
    );
}

export default WS;
